import React from 'react';
import './App.css';
import {Nav, Navbar, Container} from 'react-bootstrap/Nav'
import { BrowserRouter as Router,Routes, Route, Link } from 'react-router-dom';
import Home from './component/home';
import Contact from './component/contact';
import Resume from './component/resume';
import Projects from './component/projects';

class PersonalWebsite extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
       <Router>
        <div>
          <Nav justify variant="tabs" defaultActiveKey="/home">
            <Nav.Item>
              <Nav.Link href="/">Home</Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link href="/resume">Resume</Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link href="/projects">Projects</Nav.Link>
            </Nav.Item>
            <Nav.Item>
            <Nav.Link href="/contact">Contact</Nav.Link>
            </Nav.Item>
          </Nav>
          {/* <ul class="nav nav-tabs nav-fill" role="tablist">
            <li class="nav-item">
              <Link to="/" class="nav-link active" role="tab" aria-controls="home" aria-selected="true">Home</Link>  
            </li>
            <li class="nav-item">
              <Link to="/resume" class="nav-link" role="tab" aria-controls="resume" aria-selected="true">Resume</Link>  
            </li>
            <li class="nav-item">
              <Link to="/projects" class="nav-link" role="tab" aria-controls="projects" aria-selected="true">Projects</Link>  
            </li>
            <li class="nav-item">
              <Link to="/contact" class="nav-link" role="tab" aria-controls="home" aria-selected="true">Contact</Link>  
            </li>
          </ul> */}
          {/* <div class="tab-content"> */}
           <Routes>
            <Route exact path='/' element={< Home />}></Route>
            <Route exact path='/resume' element={< Resume />}></Route>
            <Route exact path='/projects' element={< Projects />}></Route>
            <Route exact path='/contact' element={< Contact />}></Route>
          </Routes>
            {/* <div class="tab-pane fade show active" id="home" role="tabpanel" aria-labelledby="home-tab"> <Home /> </div> */}
          {/* </div> */}
        </div>
      </Router>
    );
  }
};

export default PersonalWebsite;
